Drop Table If Exists [dbo].[Song]
-- One to one relationship with Artist.
CREATE TABLE [dbo].[Song]
(
[Id] INT NOT NULL PRIMARY KEY IDENTITY,
    [ArtistId] INT FOREIGN KEY REFERENCES [dbo].[Artist](Id),
    [Title] NVARCHAR(200) NOT NULL,
    [Added] datetime,
    [Updated] datetime
)

